function ResultSummary(props) {
  const breed = props.breed;
  const maxBreed = props.maxBreed;

  const style = {
    width: "100%",
    height: "100%",
    display: "flex",
    alignItems: "center",
  };
  const element = (
    <div style={style}>
      <h1 className="fw-bold">
        {breed} 이름으로는 <br></br> '{maxBreed[0]}'가 가장 인기가 많아요.
      </h1>
    </div>
  );

  return element;
}

export default ResultSummary;
